import React from 'react';
import { Navibar } from 'react-bootstrap';

export default function Navbar() {
    return (
        <div className='Navbar'>
            <Navbar bg="dark" variant="dark">
                <Navbar.Brand href="#home">
                <img
                    alt=""
                    src="/logo.svg"
                    width="30"
                    height="30"
                    className="d-inline-block align-top"
                />{' '}
                React Bootstrap
                </Navbar.Brand>
            </Navbar>
        </div>
    )
}
